import React, { useEffect } from 'react';
//import { Link, withRouter } from 'react-router-dom';
import { getData } from '../actions/data';
import { connect } from 'react-redux';
import PropTypes from 'prop-types';

const DataView = ({ data, getData, props }) => {
	useEffect(() => {
		getData();
	}, [getData]);

	data.map(item => {
		console.log(item);
	});

	console.log(data);

	// // console.log(results);
	// if (results !== null) {
	// 	//console.log(results[0]);
	// 	const newsObj = results.map(items => {
	// 		return items.data;
	// 	});

	// 	console.log(newsObj);
	// 	console.log(data.data);
	// }

	return <h1 onClick={getData}>Reader</h1>;
};

DataView.propTypes = {
	DataView: PropTypes.func.isRequired,
	data: PropTypes.object.isRequired
};

const mapStateToProps = state => ({
	data: state.data
});

export default connect(mapStateToProps, { getData })(DataView);
